import React from 'react';

export default function Pokemon() {
    return (
        <div>
            Id: ...
            <img src="???" alt="Pokemon image" />
        </div>
    );
}

export async function getStaticProps({ params }) {
    console.log(params);
    return {
        props: {}
    }
}

export async function getStaticPaths() {
    return {
        paths: [
            {
                params: {
                    id: '1',
                },
            },
            {
                params: {
                    id: '2',
                },
            }
        ],
        fallback: false,
    };
}
